import React from "react";
import ReactPlayer from "react-player";
import quizOneBackground from "../visuals/quiz/q1_background.mp4";
import title from "../images/quiz/q1/title.png";

export default function questionOne() {
  return (
    <div className="questionContainer">
      <ReactPlayer
        className="react-player quiz-video"
        url={quizOneBackground}
        width="100%"
        height="100%"
        controls={false}
        loop={true}
        playing={true}
      />
      <div className="questionThree_container">
        <div className="row">
          <h1>slow</h1>
          <h1>exhale</h1>
          <h1>fast</h1>
        </div>
        <div className="row">
          <h1>slow</h1>
          <h1>exhale</h1>
          <h1>fast</h1>
        </div>
        <div className="row">
          {" "}
          <h1>slow</h1>
          <h1>exhale</h1>
          <h1>fast</h1>
        </div>
      </div>
      <Link to="/question-four">Room four </Link>
    </div>
  );
}
